{% load static %}
<!DOCTYPE html>
<html>
<head>
    <meta charset="UTF-8" />
    <meta name="viewport" content="width=device-width, initial-scale=1.0" />
    <meta http-equiv="X-UA-Compatible" content="ie=edge" />
    <link rel="stylesheet" href="https://www.w3schools.com/w3css/4/w3.css" />
    <link rel="stylesheet" href="https://www.w3schools.com/lib/w3-theme-black.css">
    <link rel="stylesheet" href="https://fonts.googleapis.com/css?family=Roboto">
    <link rel="stylesheet" href="https://cdnjs.cloudflare.com/ajax/libs/font-awesome/4.7.0/css/font-awesome.min.css">
    <title>Employee Management</title>
    <style>
      html,body,h1,h2,h3,h4,h5,h6 {font-family: "Roboto", sans-serif;}
      html, body { height: 100%; background-color: #dbdbdb }
      label {
        display: block;
      }
      input{
        display: block;
        width: 100%;
        padding: 6px;
        border: 1px solid #b5b5b5;
      }
      input {
        width: 100%;
        max-width: 500px;
        border-radius: 4px;
        border-radius: 4px;
        background-color: #e5e5e5;
      }
      .w3-card-2 {
          margin-top: 80px;
          margin-inline: auto;
          display: flex;
          max-width: 500px;
          background-color: whitesmoke;
          height: 100%;
          flex-direction: column;
          justify-content: center;
          padding-inline: 53px!important;
      }
      .w3-card-2.w3-container.w3-round-medium.w3-padding-64 {
          background-color: #d7d7d796;
          backdrop-filter: blur(4px);
      }
    </style>
  </head>
  <body class='image'>

    <div class="w3-top">
      <div class="w3-bar w3-theme w3-top w3-left-align w3-large">
        <span href="#" class="w3-bar-item w3-button w3-theme-l1">Employee Management System</span>
      </div>
    </div>

    <div class='w3-padding'>
      <div class='w3-card-2 w3-container w3-round-medium w3-padding-64'>
      <h2>Manager Login</h2>
      <form method="post">
        {% csrf_token %} {{ form.as_p }}
        <button type="submit" class="w3-button w3-black w3-round-medium">Login</button>
      </form>
      </div>
    </div>
